CREATE TABLE statistics (difficulty integer, id integer, sentiments integer, statistics integer)
CREATE TABLE publication (day integer, full text, id integer, month integer, month_name text, year integer)
CREATE TABLE author (birth integer, death integer, id integer, name text)
CREATE TABLE classic (book integer, id integer, metadata integer, statistics integer)
CREATE TABLE languages (id integer, languages text)
CREATE TABLE difficulty (automated_readability_index real, coleman_liau_index real, dale_chall_readability_score real, difficult_words integer, flesch_kincaid_grade real, flesch_reading_ease real, gunning_fog real, id integer, linsear_write_formula real, smog_index real)
CREATE TABLE book (author integer, congress_classifications integer, id integer, languages integer, publication integer, subjects integer, title text, type text)
CREATE TABLE sentiments (id integer, polarity real, subjectivity real)
CREATE TABLE formats (id integer, total integer, types integer)
CREATE TABLE congress_classifications (id integer, congress_classifications text)
CREATE TABLE subjects (id integer, subjects text)
CREATE TABLE types (id integer, types text)
CREATE TABLE metadata (downloads integer, formats integer, id integer, rank integer, url text)













